								<p>You can use the theme editor to edit the individual CSS and PHP files which make up your theme.</p><p>Begin by choosing a theme to edit from the dropdown menu and clicking the Select button. A list then appears of the theme?s template files. Clicking once on any file name causes the file to appear in the large Editor box.</p><p>For PHP files, you can use the Documentation dropdown to select from functions recognized in that file. Look Up takes you to a web page with reference material about that particular function.</p><p id="editor-keyboard-trap-help-1">When using a keyboard to navigate:</p><ul><li id="editor-keyboard-trap-help-2">In the editing area, the Tab key enters a tab character.</li><li id="editor-keyboard-trap-help-3">To move away from this area, press the Esc key followed by the Tab key.</li><li id="editor-keyboard-trap-help-4">Screen reader users: when in forms mode, you may need to press the Esc key twice.</li></ul><p>After typing in your edits, click Update File.</p><p><strong>Advice:</strong> Think very carefully about your site crashing if you are live-editing the theme currently in use.</p><p>Upgrading to a newer version of the same theme will override changes made here. To avoid this, consider creating a <a href="https://developer.wordpress.org/themes/advanced-topics/child-themes/">child theme</a> instead.</p>							</div>
